import { Link } from "react-router-dom";

const TitleBar = ({type, text, info}) => {
    return (
        <div className="formBar">
            <Link to={"/"}>
                <img src={logo} alt="Doggo Api Logo" className="logo" />
            </Link>
            {type === "landing" ? (
                <h1 className="title">Welcome to DoggoApi</h1>
            ) : (
                <h1 className="title">{type === "form" ? "Create your own breed!" : info}</h1>
            )}
            {type !== "landing" && (
                <Link to = {`/Dogs`}>
                    <button className="backButton">{text}</button>
                </Link>
            )}
        </div>
    )
}

export default TitleBar;
